import Training from "./Training"
import { useGlobalContext } from '../context'

function TrainingList(){
    const trainings = useGlobalContext()

    return(
        <>
            <h1>Traininguri</h1>
            <div>
                {trainings.map((item) => {
                return <Training key={trainings.id} {...item} />
                })}
            </div>
        </>
    )
}

export default TrainingList
